import Swapy from 'swapy';

function TodoItem({ text, completed, swapy }) {
  // Usa una función de Swapy si es necesario
  const handleSwapy = () => {
    Swapy.someMethod(swapy); // Ajusta `someMethod` a lo que necesites usar de Swapy
  };

  return (
    <li
      className={`li_todos ${completed ? "completed" : ""}`}
      data-swapy-item={swapy}
      onClick={handleSwapy}
    >
      <span className={`span_accion ${completed ? "completedItem" : ""}`}>V</span>
      <p>{text}</p>
      <span className="span_accion deleteItem">X</span>
    </li>
  );
}
export {TodoItem};
